webpackJsonp([0x7c7b9a9c056f],{1260:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Psyked.co.uk",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/link-voice-synthesis-in-adobe-air-2-0/index.md absPath of file >>> MarkdownRemark",html:'<p><img src="/content/images/2010/04/voice-synth.png" title="Voice Synth with AIR 2.0"></p>\n<p>Here\'s another cool library for AIR applications.  It works for both Windows and Mac environments, and uses the NativeProcess access of AIR version 2 to tap into the built-in voice synthesis functionality of the operating system.  It\'s still in development, is more developed for Mac than for Windows (at the moment) but it\'s looking pretty good already.</p>\n<p>Should be a good one to have a play with soon!</p>\n<p>Read the authors\' blog post here: <a href="http://blog.technolog33k.fr/adobe-air/20-12-2009-voice-synthesis-in-adobe-air-with-the-nativeprocess-api/">http://blog.technolog33k.fr/adobe-air/20-12-2009-voice-synthesis-in-adobe-air-with-the-nativeprocess-api/</a></p>\n<p>Access the source code for the library from the Google code repository here: <a href="http://code.google.com/p/nativespeech/">http://code.google.com/p/nativespeech/</a></p>',frontmatter:{title:"Link: Voice synthesis in Adobe AIR 2.0",date:"April 09, 2010",tags:["voice-synthesis"],url:null}}},pathContext:{prev:{frontmatter:{path:"/blog/link-why-the-flex-advanceddatagrid-sucks/",tags:["flex","flex-framework"],title:"Link: Why the Flex AdvancedDataGrid sucks",image:null,date:"2009-02-19T10:24:01.000Z"}},next:{frontmatter:{path:"/blog/link-value-object-class-generator-for-as3/",tags:["actionscript","external-links"],title:"Link: Value Object Class generator for ActionScript 3",image:null,date:"2010-03-26T09:08:42.000Z"}}}}}});
